      try{
        const response=await fetch('http://localhost:3000/users');
        if(!response.ok)throw Error('somethings mising');
        const data=await response.json();
        setUser(data)
      }
      catch(err){
        console.log("error",err)
      } 
    };
    getUsers();
  },[]
  );



  return (
    <div>
    <Login 
    user={user}
    setUser={setUser}
    />
    </div>
  );
}

export default App;
